import React, { useEffect, useState } from "react";

const MovieApi = () => {
  useEffect(() => {
    fetch("http://www.omdbapi.com/?i=tt3896198&apikey=273b18f0")
      .then((res) => res.json())
      .then((data) => data);
  });
  return (
    <div>
      <div></div>
    </div>
  );
};

export default MovieApi;
